//Plots an ellipse given the centre coordinates and the a, and b which are the
//lenths from the center to the horizontal vetex and centre to the vertical vertex
//respectivly. Can also choose which section of the ellipse needs to be drawn, any
//half or quarter
void plot_ellipse(int centre_x, int centre_y, float a, float b, short int colour, int choice){

	int x_offset = 0;

	if (choice == FULL){

		for (int y_offset = -b; y_offset <= b; y_offset ++){

			x_offset = a * (sqrt(1 - ((y_offset * y_offset) / (b * b))));
			draw_line(centre_x - x_offset, centre_y + y_offset, centre_x + x_offset, centre_y + y_offset, colour);
		}
	}else if(choice == TOPHALF){

		for (int y_offset = -b; y_offset <= 0; y_offset ++){

			x_offset = a * (sqrt(1 - ((y_offset * y_offset) / (b * b))));
			draw_line(centre_x - x_offset, centre_y + y_offset, centre_x + x_offset, centre_y + y_offset, colour);
		}

	}else if (choice == BOTTOMHALF){

		for (int y_offset = 0; y_offset <= b; y_offset ++){

			x_offset = a * (sqrt(1 - ((y_offset * y_offset) / (b * b))));
			draw_line(centre_x - x_offset, centre_y + y_offset, centre_x + x_offset, centre_y + y_offset, colour);
		}
	}else if (choice == LEFTHALF){

		for (int y_offset = -b; y_offset <= b; y_offset ++){

			x_offset = a * (sqrt(1 - ((y_offset * y_offset) / (b * b))));
			draw_line(centre_x - x_offset, centre_y + y_offset, centre_x, centre_y + y_offset, colour);
		}
	}else if (choice == RIGHTHALF){

		for (int y_offset = -b; y_offset <= b; y_offset ++){

			x_offset = a * (sqrt(1 - ((y_offset * y_offset) / (b * b))));
			draw_line(centre_x, centre_y + y_offset, centre_x + x_offset, centre_y + y_offset, colour);
		}

	}else if (choice == FIRSTQUAD){

		for (int y_offset = -b; y_offset <= 0; y_offset ++){

			x_offset = a * (sqrt(1 - ((y_offset * y_offset) / (b * b))));
			draw_line(centre_x, centre_y + y_offset, centre_x + x_offset, centre_y + y_offset, colour);
		}
	}else if (choice == SECONDQUAD){

		for (int y_offset = -b; y_offset <= 0; y_offset ++){

			x_offset = a * (sqrt(1 - ((y_offset * y_offset) / (b * b))));
			draw_line(centre_x - x_offset, centre_y + y_offset, centre_x, centre_y + y_offset, colour);
		}
	}else if (choice == THIRDQUAD){

		for (int y_offset = 0; y_offset <= b; y_offset ++){

			x_offset = a * (sqrt(1 - ((y_offset * y_offset) / (b * b))));
			draw_line(centre_x - x_offset, centre_y + y_offset, centre_x, centre_y + y_offset, colour);
		}
	}else if (choice == FOURTHQUAD){

		for (int y_offset = 0; y_offset <= b; y_offset ++){

			x_offset = a * (sqrt(1 - ((y_offset * y_offset) / (b * b))));
			draw_line(centre_x, centre_y + y_offset, centre_x + x_offset, centre_y + y_offset, colour);
		}
	}else{

		return;
	}
}

