//Plots pixel only if its within the screen therefore makes it easier to animate
//objects partially out of the screen without errors
void plot_pixel(int x, int y, short int line_color) {
	if(y > 239 || y < 0 || x > 319 || x < 0){
		return;
	}
	*(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void wait_for_vsync(volatile int* pixel_ctrl_ptr) {

	//Initiate Swap by writing 1 into pixel buffer
	*pixel_ctrl_ptr = 1;

	//Poll S-bit
	register int status = *(pixel_ctrl_ptr + 3);

	while ( ( status & 0x01 ) != 0 ) {

		status = *(pixel_ctrl_ptr + 3);

	}
}

void clear_screen() {

	for (int i = 0; i < RESOLUTION_X; i++) {

		for (int j = 0; j < RESOLUTION_Y; j++) {

			if ( *(short int *)(pixel_buffer_start + (j << 10) + (i << 1)) != 0x0000 ) {

				*(short int *)(pixel_buffer_start + (j << 10) + (i << 1)) = 0x0000;
			}

		}

	}

}

void draw_line(int x0, int y0, int x1, int y1, short int line_color) {

	int is_steep = abs(y1-y0) > abs(x1-x0);

	if (is_steep) {

		swap(&x0, &y0);
		swap(&x1, &y1);

	}

	if (x0 > x1) {

		swap(&x0, &x1);
		swap(&y0, &y1);

	}

	int deltax = x1 - x0;
	int deltay = abs(y1 - y0);
	int error = - ( deltax / 2 );
	int y = y0;
	int y_step = 1;

	if (y0 < y1) { y_step = 1; }
	else { y_step = -1; }

	for (int x = x0; x <= x1; x++) {

		if (is_steep) { plot_pixel(y, x, line_color); }

		else { plot_pixel(x, y, line_color); }

		error += deltay;

		if ( error >= 0) {

			y += y_step;
			error -= deltax;

		}
	}
}

void swap(int* point1, int* point2) {

	int temp = *point1;
	*point1 = *point2;
	*point2 = temp;

}

void text_box(int x1, int x2, int y1, int y2) {

	for (int i = x1; i < x2; i++) {

		for (int j = y1; j < y2; j++) {

			if ( *(short int *)(pixel_buffer_start + (j << 10) + (i << 1)) != ORANGE ) {

				*(short int *)(pixel_buffer_start + (j << 10) + (i << 1)) = ORANGE;
			}

		}

	}

}

void text_display(int x, int y, char * text_ptr) {

	volatile char * character_buffer = (char *)FPGA_CHAR_BASE;
	int char_buffer_offset = (y << 7) + x;

	while ( *text_ptr ) {
		delay();
		*(character_buffer + char_buffer_offset) = *(text_ptr);
		text_ptr++;
		char_buffer_offset++;

	}
}

void display_on_HEX(int value, int state) {
	volatile int* HEX30_ptr = (int*)HEX3_HEX0_BASE;

	int ones = value % 10;
	int tens = ( value/10 ) % 10;
	int hundys = ( value/100 ) % 10;
	int thousands = ( value/1000) % 10;

	ones = HEX_code[ones];
	tens = HEX_code[tens];
	hundys = HEX_code[hundys];
	thousands = HEX_code[thousands];

	*HEX30_ptr = ones + (tens << 8) + (hundys << 16) + (thousands << 24);

	//Specify what is being displayed on hex
	volatile int* HEX54_ptr = (int*)HEX5_HEX4_BASE;

	if ( state == 2 ) {

		*HEX54_ptr = (0b1110110 << 8) + (0b1101101); //Display HS for high score

	} else if ( state == 1 ) {


		*HEX54_ptr = (0b0111001 << 8) + (0b1101101); //Display CS for Current Score

	} else {

		//Clear hex display
		*HEX30_ptr = 0x00000000;
		*HEX54_ptr = (0b0000000 << 8) + (0b0000000);

	}

}

