void draw_InitialState() {

	clear_screen();
	text_display( 35, 29, "                                     \0");

	//Fill backbuffer
	draw_tank(TANKX, TANKY, GREEN);
	plot_box( 0, 205, 320, 35, ORANGE);	//DRAW FLOOR TO SCREEN
	plot_healthbar();

	//Swap back and front buffer
	wait_for_vsync(pixel_ctrl_ptr);
	pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer

	clear_screen();

	text_display( 35, 29, "                       \0");

	//Fill new backbuffer
	draw_tank(TANKX, TANKY, GREEN);
	plot_box( 0, 205, 320, 35, ORANGE);	//DRAW FLOOR TO SCREEN
	plot_healthbar();

	//Reset variable to initialize the starting position and stages of animations
	for(int i = 0; i < 4; i++){

		shell_pos[i] = -500;

	}

	bullet_pos = 4;
	tank_explosion_stage = 0;
	cloud_pos = 319;
	enemyTank_pos = 319;

	for(int i = 0; i < 9; i++){

		enemy_shell_pos[i] = 500;

	}

	total_score = 0;
	health_loss = 0;

	startGame = false;

	for(int i = 0; i < 4; i++){

		shell_fired[i] = false;

	}

	for(int i = 0; i < 9; i++){

		enemy_shell_fired[i] = false;

	}

		bullet_fired = false;
		enemy_destroyed = false;
		gameOver = false;
		roll_enemyIn = true;
		strike = false;
		enemy_frequency = 9;

	display_on_HEX(high_score, 2);

}

void config_A9PrivTimer(){

	int* A9_private_ptr = (int*)MPCORE_PRIV_TIMER;

	//Load the "load" register such that it counts 1 second
	*A9_private_ptr = 30000000;

	*(A9_private_ptr + 3) = 0x01;

}

void delay() {

	config_A9PrivTimer();

	volatile int* A9_private_ptr = (int*)MPCORE_PRIV_TIMER;

	*(A9_private_ptr + 2) = 0x01;

	volatile register int status = *(A9_private_ptr + 3);

	while ( ( status & 0x01) == 0 ) {

		status = *(A9_private_ptr + 3);

	}

	*(A9_private_ptr + 3) = status;

	return;
}
